import Header from '../components/Header'
import InfoCard from '../components/InfoCard'
import Footer from '../components/Footer'

class Lessons extends Component{
    render(){
        return(
            <div className ="container">
                <Header />
                <InfoCard />
                <Footer />
            </div>
        )
    }
}

export default Lessons;
